import React from 'react';

//componenti da react-bootstrap
import { Container, Row, Col } from 'react-bootstrap';

//icone da material ui-icons
import CopyrightIcon from '@material-ui/icons/Copyright';

//Componenti nostre
import Logo from '../../../immagini/logo1.png'

export default class Footer extends React.Component{ 
    constructor(props){ 
       super(props); 
    }
    render(){ 
        return(
        <div className="Footer" > 
            <Container fluid>
                <Row>
                <Col  sm={4}>
                <img src={Logo} alt="Karm-Logo-Footer" width='120em'/>
                </Col>
                <Col  sm={4}>
                    <h6>Azienda</h6>
                    <h6>Chi Siamo</h6> <br />
                    <h6>Instagram</h6> <br />
                </Col>
                <Col  sm={4}>
                    <h6>Contattaci</h6> 
                    <h6>Gabriele +39 3803719481</h6><br />
                    <h6>Salvatore +39 3803719481</h6><br />
                    <h6>Maria +39 3803719481</h6><br />
                    <h6>Giuseppe +39 3803719481</h6><br />
                </Col>
                </Row>
                <Row>
                <Col className="Copyright" sm={12} style={{ textAlign: 'center' }}>
                <CopyrightIcon style={{ fontSize: 20}}/> <h7>TEAM KARM 2021</h7>
                </Col>
                </Row>
            </Container>
        </div>
       ); 
    }
 }
